comment_message:
So many good things have happened tonight.

) We won & we are through 
) Welbeck broke his scoring draught 
) Borrusia Dortmund got knocked out so Aubameyang is eligible to play in the Europa League in the next round for us

I tre gol di stasera: 
- rigore inesistente;
- errore indecente di Donnarumma;
- fuorigioco di Welbeck.
I due gol a San Siro: 
- deviazione sul tiro di Mkhitaryan;
- palla persa in maniera banale dal Milan. 
Che l'Arsenal sia pi forte  vero, che abbia strameritato di vincere entrambi gli incontri e passare il turno...non saprei
